<div class="entities" style="line-height: 2.5; direction: ltr">Vitamin D analogues . The plethora of actions attributed to 1,25 ( OH ) 2D3 throughout the body have suggested potential therapeutic applications for the treatment of hyperproliferative diseases , immune dysfunction , endocrine disorders , and metabolic bone disease . However , the potent calcemic activity of the natural vitamin D hormone has precluded its use in most cases . New vitamin D analogues are under development that display greater specificity , in most cases , by retaining the therapeutic properties of 1,25 ( OH ) 2D3 , but with lower calcemic activity . Two analogues have been approved for use in patients : calcipotriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02300
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 from Leo Pharmaceuticals , Copenhagen , Denmark ) for the treatment of psoriasis ; and 19 - nor -1,25 ( OH ) 2D2 ( DB00910 from Abbott Laboratories , Abbott Park , IL ) for secondary hyperparathyroidism . Many others analogues are currently being tested in preclinical and clinical trials for the treatment of various types of cancer and osteoporosis , and for immunosuppression . The selectivity of the analogues can be attributed to the combined interactions with four proteins : the vitamin D receptor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P11473
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , the serum vitamin D binding protein ( DBP ) , the vitamin D - 24 - hydroxylase and to a newly described membrane receptor . Low DBP affinity has been shown to be responsible for the reduced calcemic actions of calcipotriol and 22 - oxacalcitriol ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O75051
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , which is being tested for secondary hyperparathyroidism . However , the low calcemic activity of other analogues , including 19 - nor -1,25 ( OH ) 2D2 , involves other , as yet undefined , mechanisms . Understanding of the molecular basis for the selectivity of the vitamin D analogues will allow the design of more effective and safer vitamin D compounds for the treatment of a wide range of clinical disorders .</div>

 ( DX - 88 ) is a potent and specific inhibitor of plasma kallikrein .

 supports long-term self-renewal and suppresses mesoderm and endoderm activities of human embryonic stem cells . Despite the recent identification of the transcriptional regulatory circuitry involving

 ) in regulating hESC long-term undifferentiated growth . Inhibition of

<h2 style="margin: 0">7</h2>

 rediscovered : the new biology and targeting the androgen receptor therapeutically . Discoveries over the past decade suggest that castration-resistant prostate cancer ( CRPC ) is sensitive , but not resistant to , further manipulation of the androgen-androgen receptor ( AR ) axis . Several new therapies that target this axis have demonstrated clinical activity . In this article , preclinical and clinical findings occurring in the field of AR-targeted therapies are reviewed . Reviews of scientific and clinical development are divided into those occurring prereceptor ( androgen production and conversion ) and at the level of the receptor ( AR aberrations and therapies targeting AR directly ) . Intracrine androgen production and AR amplification , among others , are among the principal aberrancies driving CRPC growth . Phase III data with abiraterone acetate and phase II data with

 , along with other similar therapies , confirm for the clinician that the scientific findings related to persistent AR signaling in a castrate milieu can be harnessed to produce significant clinical benefit for patients with the disease . Studies aimed at optimizing the timing of their use and exploring the mechanisms of resistance to these therapies are under way . The clinical success of therapies that directly target androgen synthesis as well as the most common aberrancies of the AR confirm that prostate cancer retains dependence on AR signaling , even in the castrate state .</div>

<h2 style="margin: 0">8</h2>

 gamma agonist-induced hepatotoxicity remains unknown . In this study , we examined the hepatotoxic effects of five

 gamma agonists ( ciglitazone , pioglitazone , rosiglitazone , troglitazone , and

 ) on rat primary hepatocytes and human HepG 2 cells . We also compared the gene expression profiles of rat primary hepatocytes after exposure to

 gamma agonists by using the Rat Genome Survey Microarray system from Applied Biosystems in order to understand the mechanisms of hepatotoxicities induced by PPARgamma agonists . Consistent with the hepatotoxicity data , our results demonstrate that the gene expression profiles affected by troglitazone and ciglitazone can be clearly distinguished from those by pioglitazone and rosiglitazone . Genes that are differentially expressed between the more toxic troglitazone / ciglitazone group and the less toxic rosiglitazone / pioglitazone group are involved in necrotic , apoptotic , and cell proliferative pathways . The five compounds were also clustered based on a set of molecular descriptors . The clustering based on chemical structural information is in good agreement with the clustering of compounds based on cytotoxicity or gene expression data , indicating a strong relationship between chemical structure and biological endpoints . Our work suggests that microarray analysis together with toxicological observations can be used to rank drugs for hepatotoxicity and to evaluate the safety of new compounds .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">

 antagonist potentiated insulin action in fed but not fasted state . The glucose disposal effect of insulin is doubled in response to a meal . This meal-induced insulin sensitization results from insulin acting on the liver , in the presence of a permissive hepatic parasympathetic feeding signal and elevated hepatic glutathione ( DB00143 ) , to release hepatic insulin-sensitizing substance ( HISS ) , a hormone that acts selectively on skeletal muscle to stimulate insulin-mediated glucose uptake . Blockade of the parasympathetic feeding signal to the liver , either through surgical denervation or atropine-mediated antagonism of hepatic muscarinic receptors , eliminates the HISS response , resulting in HISS-dependent insulin resistance ( HDIR ) and decreasing the response to insulin by approximately 55 % in the fed state .

 action in Sprague-Dawley rats , as determined with a rapidly sampled , transient euglycemic clamp in response to insulin ( 50 mU / kg ) , is decreased in a dose-dependent manner by atropine . In this study , we have used the ED75 atropine-induced model of HDIR . After a submaximal dose of atropine , potentiation of the remaining parasympathetic effect with the acetylcholinesterase antagonist neostigmine significantly restored postprandial insulin sensitization in a dose-dependent manner with peak effect at 0.1 microg / kg / min .

 reversed the insulin resistance induced by partial fasting and partial muscarinic inhibition ( hepatic DB00143 levels are at fed levels ) , but not that induced by surgical hepatic denervation ( DB00143 normal , no nerve signal ) or 24 - h fasting ( low DB00143 ) . No potentiation of the response to insulin by neostigmine occurred in normal , fed rats . The data suggest the use of either direct or indirectly acting cholinergic agonists for the treatment of impaired postprandial insulin sensitization .</div>

<h2 style="margin: 0">12</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">L-tryptophan-mediated enhancement of susceptibility to nonalcoholic fatty liver disease is dependent on the mammalian target of rapamycin . Nonalcoholic fatty liver disease is one of the most common liver diseases . L-tryptophan and its metabolite serotonin are involved in hepatic lipid metabolism and inflammation . However , it is unclear whether L-tryptophan promotes hepatic steatosis . To explore this issue , we examined the role of L-tryptophan in mouse hepatic steatosis by using a high fat and high fructose diet ( HFHFD ) model . L-tryptophan treatment in combination with an HFHFD exacerbated hepatic steatosis , expression of HNE-modified proteins , hydroxyproline content , and serum alanine aminotransaminase levels , whereas L-tryptophan alone did not result in these effects . We also found that L-tryptophan treatment increases serum serotonin levels . The introduction of adenoviral aromatic amino acid decarboxylase , which stimulates the serotonin synthesis from L-tryptophan , aggravated hepatic steatosis induced by the HFHFD . The fatty acid-induced accumulation of lipid was further increased by serotonin treatment in cultured hepatocytes . These results suggest that L-tryptophan increases the sensitivity to hepatic steatosis through serotonin production . Furthermore , L-tryptophan treatment , adenoviral
